class PasswordConfirmation {
	constructor(form) {
		this.form = form
		this.password = form.elements.user_password
		this.password_confirm = form.elements.user_password_confirm

		console.log('Found reg_form. And maybe elements.')
	}
}

console.log('show_passwords_match.js working')
var reg_form = document.getElementById("new_user")
console.log('reg_form:')
console.log(reg_form)
if (reg_form) new PasswordConfirmation(reg_form)
